      returnType: null,
      doc: '<p>Telnet library can be imported with optional configuration parameters.</p>\n<p>Configuration parameters are used as default values when new connections are opened with <a href="#Open%20Connection" class="name">Open Connection</a> keyword. They can also be overridden after opening the connection using the <span class="name">Set ...</span> <a href="#Keywords" class="name">keywords</a>. See these keywords as well as <a href="#Configuration" class="name">Configuration</a>, <a href="#Terminal%20emulation" class="name">Terminal emulation</a> and <a href="#Logging" class="name">Logging</a> sections above for more information about these parameters and their possible values.</p>\n<p>See <a href="#Time%20string%20format" class="name">Time string format</a> and <a href="#Boolean%20arguments" class="name">Boolean arguments</a> sections for information about using arguments accepting times and Boolean values, respectively.</p>\n<p>Examples (use only one of these):</p>\n<table border="1">\n<tr>\n<th>Setting</th>\n<th>Value</th>\n<th>Value</th>\n<th>Value</th>\n<th>Value</th>\n<th>Comment</th>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td></td>\n<td></td>\n<td></td>\n<td># default values</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>5 seconds</td>\n<td></td>\n<td></td>\n<td># set only timeout</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>newline=LF</td>\n<td>encoding=ISO-8859-1</td>\n<td></td>\n<td># set newline and encoding using named arguments</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>prompt=$</td>\n<td></td>\n<td></td>\n<td># set prompt</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>prompt=(&gt; |# )</td>\n<td>prompt_is_regexp=yes</td>\n<td></td>\n<td># set prompt as a regular expression</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>terminal_emulation=True</td>\n<td>terminal_type=vt100</td>\n<td>window_size=400x100</td>\n<td># use terminal emulation with defined window size and terminal type</td>\n</tr>\n<tr>\n<td>Library</td>\n<td>Telnet</td>\n<td>telnetlib_log_level=NONE</td>\n<td></td>\n<td></td>\n<td># disable logging messages from the underlying telnetlib</td>\n</tr>\n</table>',
