      doc: '<p>Closes all open connections and empties the connection cache.</p>\n<p>If multiple connections are opened, this keyword should be used in a test or suite teardown to make sure that all connections are closed. It is not an error if some of the connections have already been closed by <a href="#Close%20Connection" class="name">Close Connection</a>.</p>\n<p>After this keyword, new indexes returned by <a href="#Open%20Connection" class="name">Open Connection</a> keyword are reset to 1.</p>',
