      returnType: null,
      doc: '<p>Executes the given <code>command</code> and reads, logs, and returns everything until the prompt.</p>\n<p>This keyword requires the prompt to be <a href="#Configuration">configured</a> either in <a href="#Importing" class="name">importing</a> or with <a href="#Open%20Connection" class="name">Open Connection</a> or <a href="#Set%20Prompt" class="name">Set Prompt</a> keyword.</p>\n<p>This is a convenience keyword that uses <a href="#Write" class="name">Write</a> and <a href="#Read%20Until%20Prompt" class="name">Read Until Prompt</a> internally. Following two examples are thus functionally identical:</p>\n<table border="1">\n<tr>\n<td>${out} =</td>\n<td><a href="#Execute%20Command" class="name">Execute Command</a></td>\n<td>pwd</td>\n</tr>\n</table>\n<table border="1">\n<tr>\n<td><a href="#Write" class="name">Write</a></td>\n<td>pwd</td>\n</tr>\n<tr>\n<td>${out} =</td>\n<td><a href="#Read%20Until%20Prompt" class="name">Read Until Prompt</a></td>\n</tr>\n</table>\n<p>See <a href="#Logging" class="name">Logging</a> section for more information about log levels and <a href="#Read%20Until%20Prompt" class="name">Read Until Prompt</a> for more information about the <code>strip_prompt</code> parameter.</p>',
