      returnType: null,
      doc: '<p>Opens a new Telnet connection to the given host and port.</p>\n<p>The <code>timeout</code>, <code>newline</code>, <code>prompt</code>, <code>prompt_is_regexp</code>, <code>encoding</code>, <code>default_log_level</code>, <code>window_size</code>, <code>environ_user</code>, <code>terminal_emulation</code>, <code>terminal_type</code> and <code>telnetlib_log_level</code> arguments get default values when the library is <a href="#Importing">imported</a>. Setting them here overrides those values for the opened connection. See <a href="#Configuration" class="name">Configuration</a>, <a href="#Terminal%20emulation" class="name">Terminal emulation</a> and <a href="#Logging" class="name">Logging</a> sections for more information about these parameters and their possible values.</p>\n<p>Possible already opened connections are cached and it is possible to switch back to them using <a href="#Switch%20Connection" class="name">Switch Connection</a> keyword. It is possible to switch either using explicitly given <code>alias</code> or using index returned by this keyword. Indexing starts from 1 and is reset back to it by <a href="#Close%20All%20Connections" class="name">Close All Connections</a> keyword.</p>',
