      doc: '<p>Sets the default log level used for <a href="#Logging" class="name">logging</a> in the current connection.</p>\n<p>The old default log level is returned and can be used to restore the log level later.</p>\n<p>See <a href="#Configuration" class="name">Configuration</a> section for more information about global and connection specific configuration.</p>',
