      returnType: null,
      doc: '<p>Writes the given text plus a newline into the connection.</p>\n<p>The newline character sequence to use can be <a href="#Configuration">configured</a> both globally and per connection basis. The default value is <code>CRLF</code>.</p>\n<p>This keyword consumes the written text, until the added newline, from the output and logs and returns it. The given text itself must not contain newlines. Use <a href="#Write%20Bare" class="name">Write Bare</a> instead if either of these features causes a problem.</p>\n<p><b>Note:</b> This keyword does not return the possible output of the executed command. To get the output, one of the <span class="name">Read ...</span> <a href="#Keywords" class="name">keywords</a> must be used. See <a href="#Writing%20and%20reading" class="name">Writing and reading</a> section for more details.</p>\n<p>See <a href="#Logging" class="name">Logging</a> section for more information about log levels.</p>',
      shortdoc: "Writes the given text plus a newline into the connection.",
